      name: "mayank",
      email:"mayank00@gmail.com"
    };
  }
  render() {
    return (
      <div>
        <h1>Hello {this.state.name}</h1>
        <h1>email {this.state.email}</h1>
        <button>Update Name</button>
      </div>
    );
  }
}
export default Statec;
